'''
Given a string, find the length of the longest substring without repeating characters. For example, the longest substring without repeating letters for "abcabcbb" is "abc", 
which the length is 3. For "bbbbb" the longest substring is "b", with the length of 1.
'''
class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        if s is None or s == '':
            return 0
        
        index = 0
        # dict of mapping char to index so we know when this char appeared last
        m = {} 
        #list_str = []
        _str = ''
        _max = 0
        str_len = len(s)
        
        # sliding windows
        while index < str_len:
            cursor = index
            repeated_char = ''
            temp = []
            temp.append(s[index])
            m[s[index]] = index
            
            try:
                li = s[(index+1):]
            except IndexError:
                print('handled index error')
                break
            else:
                for a in li:
                    cursor+=1
                    if a not in temp:
                        temp.append(a)
                        m[a] = cursor
                        #print('temp = {0}'.format(temp))
                    else:
                        #print('repeated {0} at {1}'.format(a, cursor))
                        repeated_char = a
                        break   
            _str = ''.join(temp)
            #print(_str)
            if len(_str) > _max:
                _max = len(_str)
            
            if cursor == (str_len - 1):
                break
#            if _str not in list_str:
#                list_str.append(_str)
#                if len(_str) > _max:
#                    _max = len(_str)
#                    print('here')
            try:
                #print('dict is {0}'.format(m))   
                index = (m[repeated_char] + 1)
                #print('new index = ' + str(index))
                #print('cursor = ' + str(cursor))
                m[repeated_char] = cursor
            except:
                #print('pass')
                index+=1
                pass
            #print(list_str)
        
#        _s = ''
#        for i in list_str:
#            if len(i) > len(_s):
#                _s = i
#                
        #print('final = ' + _s)          
        return _max


